IF OBJECT_ID('dbo.proc_transform_395', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_395;
GO
CREATE PROCEDURE dbo.proc_transform_395
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_395
    SET payload = LEFT(payload, 1000) + N'|V4-395|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_395;
END
GO
IF OBJECT_ID('dbo.audit_v4_395', 'U') IS NULL
